import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import "./Navbar.css";

const Navbar = () => {
  const user = true;
  return (
    <div className="Nav">
      <div className="navLeft">
        <i className="fa-brands fa-facebook navIcon"></i>
        <i className="fa-brands fa-twitter navIcon"></i>
        <i className="fa-brands fa-instagram-square navIcon"></i>
        <i className="fa-brands fa-github navIcon"></i>
      </div>

      <div className="navCenter">
        <ul className="navList">
          <li className="navItem"><Link to="/" style={{textDecoration: 'none'}}>Home</Link></li>
          <li className="navItem">About</li>
          <li className="navItem">Contact</li>
          <li className="navItem">Write</li>
          <li className="navItem">Logout</li>
        </ul>
      </div>
      <div className="navRight">
        <img
        className="navAvatar"
          src="data:image/jpeg;base64,"
          alt="Profile"
        />
        <i className="searchIcon fa-solid fa-magnifying-glass"></i>
      </div>
    </div>
  );
};

export default Navbar;
